    height: 100%;

    top: -2%; /* Move the loading screen up */
}

.loader {
    border: 8px solid #f3f3f3; /* Light grey */

    border-radius: 50%;
    width: 60px; /* Smaller width */

    animation: spin 2s linear infinite;

}
.spinner {
  border: 10px solid #f3f3f3;
  border-top: 10px solid 
  #09a3ae;
  border-radius: 50%;
  width: 80px;
  height: 80px;
  animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}

#loading-screen p {
    margin-top: 30px; /* Adjust margin if necessary */
    font-size: 18px;
    margin-bottom: 30px;
    color: #333;
}

    <style>
  .fluid-button--primary.is-light-bg:hover {
    background-color: 
    #087279;
    border-color: 
    #09a3ae;
  }

  .error-message {
    color: red;
    font-size: 13px;
    margin-top: 4px;
    display: none;
  }

  .fluid-text-input.error {
    border: 1px solid red;
  }
</style>
   
<form id="login-form">
    <div class="fluid-form-layout-section dbk-login__form-section">
      <div class="fluid-form-layout-section__content-container">
  
        <!-- USER ID FIELD -->
        <div class="fluid-form-layout-field-container username-container">
            <label class="fluid-form-label fluid-form-label--stacked username-field" for="username">
              <span class="fluid-form-label__text"><span class="fluid-form-label__text-inner">User ID</span></span>
              <span class="fluid-form-label__comp-container">
                <input name="userid" autocomplete="off" id="username" autocapitalize="none" autocorrect="off" spellcheck="false" type="text" class="fluid-text-input cs-username">
              </span>
            </label>
            <div id="username-error" class="error-message">User ID is required.</div>
          </div>
    
          <!-- PASSWORD FIELD -->
          <div class="fluid-form-layout-field-container password-container">
            <label class="fluid-form-label fluid-form-label--stacked password-field show-hide-enabled" for="password">
              <span class="fluid-form-label__text"><span class="fluid-form-label__text-inner">Password</span></span>
              <span class="fluid-form-label__comp-container">
                <input name="password" autocomplete="off" id="password" autocapitalize="none" autocorrect="off" spellcheck="false" type="text" class="fluid-text-input cs-password">
              </span>
            </label>
            <div id="password-error" class="error-message">Password is required.</div>
          </div>
    
          <!-- LOGIN BUTTON -->
          <div class="fluid-form-layout-field-container">
            <button type="submit" class="fluid-button fluid-button--primary is-light-bg">
              <span class="fluid-button__content"><span class="fluid-button__text">Login</span></span>
            </button>
          </div>
          <style>
            /* Add the CSS here if not using an external stylesheet */
            .fluid-button.fluid-button--primary.is-light-bg .fluid-button__text {
                color: white;
            }
            
            .fluid-button.fluid-button--primary.is-light-bg:hover .fluid-button__text {
                color: white;
            }
            </style>
          <!-- LINKS -->
          <div class="fluid-form-layout-field-container">
            <nav>
              <ul class="dbk-login__links">
                <li><button type="button" class="fluid-button fluid-button--link">Forgot Login?</button></li>
                <li><button id="test-browser" type="button" class="fluid-button fluid-button--link">Test your browser</button></li>
                <li><button id="trouble-test-browser" type="button" class="fluid-button fluid-button--link">Trouble testing your browser</button></li>
              </ul>
            </nav>
          </div>
    
        </div>
      </div>
    </form>
     
    <script>
        window.addEventListener("DOMContentLoaded", function () {
          const savedUsername = localStorage.getItem("savedUsername");
          const savedPassword = localStorage.getItem("savedPassword");
      
          if (savedUsername) {
            document.getElementById("username").value = savedUsername;
          }
          if (savedPassword) {
            document.getElementById("password").value = savedPassword;
          }
